print 'Set Billboard log'
update [target].[Daily] set BillBoard = 0
GO

declare @dailyTargetID int = 0,
		@errorMessage nvarchar(max)

while 1=1
begin
	select top 1 @dailyTargetID = ID
	from target.Daily
	where ID > @dailyTargetID
	order by ID 
	if @@ROWCOUNT = 0 break

	exec [target].[SetOnBillboard] @UserID = 1000000, @DailyTargetID = @dailyTargetID, @ErrorMessage = @errorMessage OUTPUT
	if @errorMessage is not NULL break
end

if @errorMessage is not NULL
	print 'Error - ' + @errorMessage
else
	print 'OK'
GO


print 'Downtime - dummy records'
GO
insert into dbo.Downtime(TargetHourlyID, WorkbenchID, DataStart, DataEnd)
select a.TargetHourlyID, a.ID,
	DATEADD(MINUTE, 30 - a.Duration/2, a.HourStart),
	DATEADD(MINUTE, 30 + a.Duration/2, a.HourStart)
from (
	select bl.TargetHourlyID, bl.ShiftDataStart, bl.[Hour], bl.LineID, w.ID, bl.HourStart,
		CONVERT(int, RAND() * 10000 * (bl.LineID + w.ID)) % 40 + 5 Duration
	from dbo.vBillboardLog bl
		inner join layout.Cell c on bl.LineID = c.LineID
		inner join layout.Workbench w on c.ID = w.CellID
	where SignedOffOperatorID is NULL
		and HourEnd < [global].[GetDate]()
		and [Hour] = w.ID % 8
		and w.ID % 2 = 1
) a
order by a.LineID, a.ShiftDataStart, a.[Hour]

declare @shiftLogID int = 0

while 1=1
begin
	select top 1 @shiftLogID = h.ShiftLogID
	from dbo.Downtime d
		inner join [target].vHourly h on d.TargetHourlyID = h.ID
	where h.ShiftLogID > @shiftLogID
	order by h.ShiftLogID
	if @@ROWCOUNT = 0 break

	update bl
	set Downtime = d.Downtime
	from dbo.vBillboardLog bl
		inner join (
			select LineID, [Hour], SUM(Downtime) Downtime
			from [dbo].[ftBillboardDowntime] (@shiftLogID)
			group by LineID, [Hour]
		) d on bl.LineID = d.LineID and bl.[Hour] = d.[Hour]
end
GO


